import {Meta, moduleMetadata, StoryObj} from '@storybook/angular';
import { action } from '@storybook/addon-actions';
import { FuseSearchBarComponent } from '../lib/components/search-bar/search-bar.component';
import { FuseConfigService } from '../lib/services/config.service';
import { Subject } from 'rxjs';

// Mocking the FuseConfigService
class MockFuseConfigService {
  config = new Subject<any>();
}

export default {
  title: 'UI/Fuse Search Bar',
  component: FuseSearchBarComponent,
  tags: ['autodocs'],
  decorators: [
    moduleMetadata({
      providers: [
        { provide: FuseConfigService, useClass: MockFuseConfigService }
      ],
    }),
  ],
} as Meta<FuseSearchBarComponent>;

type Story = StoryObj<FuseSearchBarComponent>;
export const Default: Story = {
  args: {
    collapsed: true
  },
};

export const Expanded: Story = {
  args: {
    collapsed: true
  },
};

export const Collapsed: Story = {
  args: {
    collapsed: false
  },
};

export const WithSearch = () => ({
  component: FuseSearchBarComponent,
  props: {},
  template: `<fuse-search-bar (inputEventEmitter)="onSearch($event)"></fuse-search-bar>`,
  methods: { onSearch: action('Search') },
});

import {Meta, moduleMetadata, StoryObj} from '@storybook/angular';
import {ActivatedRoute} from '@angular/router';
import {FuseNavigationComponent} from "../lib/components/navigation/navigation.component";
import {FuseNavigationModule} from "../lib/components/navigation/navigation.module";
import {NgIf} from "@angular/common";
import {ReactiveFormsModule} from "@angular/forms";
import {StorybookTranslateModule} from "./storybook-translate.module";
import {TranslateModule} from "@ngx-translate/core";
import {BrowserAnimationsModule} from "@angular/platform-browser/animations";
import {MOCK_NAVIGATION_DATA} from "./data/data-navigation";
import {FuseNavigationService} from "../lib/components/navigation/navigation.service";
import {FuseNavigationItem} from "../lib/types/fuse-navigation";

class MockFuseNavigationService extends FuseNavigationService{
  constructor() {
    super();
    this.register('main', MOCK_NAVIGATION_DATA as unknown as FuseNavigationItem);
    this.setCurrentNavigation('main');
  }
}

export default {
  title: 'UI/Navigation',
  component: FuseNavigationComponent,
  tags: ['autodocs'],
  decorators: [
    moduleMetadata({
      imports: [
        NgIf,
        ReactiveFormsModule,
        FuseNavigationModule,
        TranslateModule,
        StorybookTranslateModule,
        BrowserAnimationsModule
      ],
      providers: [{
        provide: ActivatedRoute,
        useValue: {
          snapshot: {
            paramMap: {
              get(): string {
                return '123';
              },
            },
          },
        },
      },
        { provide: FuseNavigationService, useClass: MockFuseNavigationService }
      ]
    }),
  ]
} as Meta<FuseNavigationComponent>;

type Story = StoryObj<FuseNavigationComponent>;
export const Primary: Story = {
  name: 'I am the primary',
  args: {
    layout: 'vertical',
    navigation: MOCK_NAVIGATION_DATA
  },
};

import {Meta, moduleMetadata, StoryObj} from '@storybook/angular';
import {FuseProgressBarComponent} from "../lib/components/progress-bar/progress-bar.component";
import {FuseProgressBarModule} from "../lib/components/progress-bar/progress-bar.module";
import {FuseProgressBarService} from "../lib/components/progress-bar/progress-bar.service";
import { Router } from '@angular/router';
import {BehaviorSubject, Observable} from "rxjs";

export class MockFuseProgressBarService {
  // Mimic the BehaviorSubject properties
  private _bufferValue = new BehaviorSubject<number>(0);
  private _mode = new BehaviorSubject<string>('indeterminate');
  private _value = new BehaviorSubject<number>(0);
  private _visible = new BehaviorSubject<boolean>(true);

  // Mock observables for public accessors
  bufferValue: Observable<any> = this._bufferValue.asObservable();
  mode: Observable<any> = this._mode.asObservable();
  value: Observable<any> = this._value.asObservable();
  visible: Observable<any> = this._visible.asObservable();

  // Mock methods for public functions
  show(): void {
    this._visible.next(true);
  }

  hide(): void {
    this._visible.next(false);
  }

  // Optionally define methods to control mock behavior
  setValue(value: number): void {
    this._value.next(value); // Example: Allow setting a specific value
  }

  setMode(value: string): void {
    if (['determinate', 'indeterminate', 'buffer', 'query'].includes(value)) {
      this._mode.next(value); // Example: Validate mode input
    } else {
      throw new Error('Invalid mode provided');
    }
  }
}

export default {
  title: 'UI/ProgressBar',
  component: FuseProgressBarComponent,
  tags: ['autodocs'],
  decorators: [
    moduleMetadata({
      imports: [FuseProgressBarModule],
      providers: [
        {
          provide: FuseProgressBarService, useClass: MockFuseProgressBarService
        }
      ]
    }),
  ]
} as Meta<FuseProgressBarComponent>;

type Story = StoryObj<FuseProgressBarComponent>;
export const Default: Story = {
  args: {},
};

